// Packages
import React from 'react';

function KTPFooter() {
  return (
    <footer>
      <div>
        <p>&copy; 2018-2020 University of Pittsburgh Kappa Theta Pi. All Rights Reserved.</p>
        <ul className='list-inline'>
          <li>
            Site created and maintained by the Pitt KTP Dev Team with
            <span style={{ color: 'red' }}> &hearts;</span>
          </li>
        </ul>
      </div>
    </footer>
  )
}

export default KTPFooter;
